<?phpnamespace Nemundo\Project\Install;use Nemundo\App\Application\Application\ApplicationApplication;use Nemundo\App\Application\Data\ApplicationModelCollection;use Nemundo\App\Application\Install\ApplicationInstall;use Nemundo\App\Application\Type\Install\AbstractInstall;use Nemundo\App\Mail\Application\MailApplication;use Nemundo\App\Scheduler\Application\SchedulerApplication;use Nemundo\App\Scheduler\Data\SchedulerModelCollection;use Nemundo\App\Script\Data\ScriptModelCollection;use Nemundo\App\Script\Setup\ScriptSetup;use Nemundo\App\WebService\Application\WebServiceApplication;use Nemundo\Dev\Script\AdminSetupScript;use Nemundo\Model\Setup\ModelCollectionSetup;use Nemundo\Project\Path\LogPath;use Nemundo\Project\Path\TmpPath;use Nemundo\Project\Script\LogDeleteScript;use Nemundo\Project\Script\ProjectCleanScript;use Nemundo\Project\Script\TmpDeleteScript;use Nemundo\User\Application\UserApplication;use Nemundo\User\Data\UserModelCollection;class ProjectInstall extends AbstractInstall{    public function install()    {        (new ModelCollectionSetup())            ->addCollection(new UserModelCollection())            ->addCollection(new ScriptModelCollection())            ->addCollection(new SchedulerModelCollection())            ->addCollection(new ApplicationModelCollection());        (new ApplicationInstall())->install();        (new WebServiceApplication())->installApp();        (new ApplicationApplication())->installApp();        (new UserApplication())->installApp();        (new SchedulerApplication())->installApp();        (new MailApplication())->installApp();        (new TmpPath())->createPath();        (new LogPath())->createPath();        (new ScriptSetup())            ->addScript(new ProjectCleanScript())            ->addScript(new TmpDeleteScript())            ->addScript(new LogDeleteScript())            ->addScript(new AdminSetupScript());    }}